import * as React from "react";
import Button from "@mui/material/Button";
import Dialog from "@mui/material/Dialog";
import "../Dashboard.css";
import Student from "../images/Student.png";
import Forgot from "../Pages/Forgot.js";

const Internal = ({ open, handleClose, onSubmit }) => {
  const [user, setUser] = React.useState("");
  const [password, setPassword] = React.useState("");

  const handleData = (isSubmit) => {
    setUser("");
    setPassword("");

    if (isSubmit) {
      if (user === "" || password === "") {
        console.log("Please Enter User Name and Password");
      } else {
        onSubmit(user, password);
      }
    } else {
      handleClose();
    }
  };

  return (
    <div>
      <Dialog
        classes={{ paper: "submit-form" }}
        open={open}
        onClose={handleClose}
      >
        <img className="dialog-title" src={Student} alt="firespot" />
        <div className="title-heading">
          <div className="sign-in">Sign In</div>
          <div className="uom-user">UOM User</div>
        </div>
        <div>
          <hr />
        </div>

        <div className="payment-amount">User Name</div>

        <input className="select-button-1" type="text" />

        <div className="payment-description-main">
          <div className="payment-description">Password</div>

          <input className="select-button-2" type="password" />
        </div>
        <div className="remember-me">
          <span>
            <input type="checkbox" />
            Remember Me
          </span>
          <span className="forgot">Forgot Password</span>
        </div>

        <div className="signin-text">
          <Button className="signin" onClick={() => handleData(true)}>
            Sign in
          </Button>
        </div>
        <div><hr/>or</div>
        <div className="dont-have">
          <div>Don't have an Account ?</div>
          <div>
            <a
              className="create-new-one"
              href={Forgot}
              target="_self"
              rel="noreferrer noopener"
            >
              Create New One
            </a>
          </div>
        </div>
      </Dialog>
    </div>
  );
};
export default Internal;
